import React, { useState, useEffect } from 'react'
import { Col, Row, Button, Container, FormInput, FormGroup, Card, CardBody, CardHeader } from "shards-react"
import api from '../api/api';
import swal from 'sweetalert';
import { useHistory } from 'react-router-dom';

const AddSupplier = () => {


    const history = useHistory()

    const [name, setName] = useState("");
    const [email, setEmail] = useState("");
    const [address, setAddress] = useState("");
    const [phone, setPhone] = useState("");
    const [mobilePhone, setMobilePhone] = useState("");
    const [country, setCountry] = useState("");
    const [city, setCity] = useState("");

    const resetForm = () => {
        setName("");
        setEmail("");
        setAddress("");
        setMobilePhone("");
        setCountry('');
        setCity('')
    }

    const addSupplier = () => {
        let data = {
            name: name,
            address: address,
            tel_mobile: mobilePhone,
            city: city,
            country: country
        }
        api.post('/supplier/add-supplier', data)
            .then(response => {
                if (response.data.type && response.data.type == "success") {
                    swal({
                        icon: 'success',
                        title: 'OK',
                        text: 'Supplier added'
                    })
                    resetForm()
                }
            }).catch(err => {
                swal({
                    icon: 'error',
                    title: 'Error',
                })
            })
    }


    return (
        <>
            <Container fluid className="main-content-container py-4">
                <Card>
                    <CardHeader className="border-bottom">
                        <div
                            style={{
                                display: "flex",
                                justifyContent: "flex-start",
                                width: "auto",
                                float: "left"
                            }}
                        >
                            <div>
                                <h6 className="m-0" style={{ textAlign: "left" }}>Supplier Information </h6>{" "}
                            </div>
                        </div>
                        <div
                            style={{
                                display: "flex",
                                justifyContent: "flex-end"
                            }}
                        >
                            <Button
                                // theme="success"
                                className="mb-2 mr-1 btn btn-success"
                                onClick={addSupplier}
                            >
                                <i class={`fa fa-check mx-2`}></i>
                                save
                            </Button>
                            <Button
                                onClick={() => history.push('/admin/users')}
                                // theme="success"
                                className="mb-2 mr-1 btn btn-danger"
                            >
                                <i class={`fa fa-times mx-2`}></i>
                                cancel
                            </Button>
                        </div>
                    </CardHeader>
                    <CardBody>
                        <Row form className="py-4">
                            <Col lg="6" md="12" sm="12" >
                                <FormGroup>
                                    <label htmlFor="name">Supplier Company Name</label>
                                    <FormInput
                                        id="name"
                                        placeholder="Name"
                                        onChange={(e) => setName(e.target.value)}
                                        value={name}
                                    />
                                </FormGroup>
                                <FormGroup>
                                    <label htmlFor="email">Email</label>
                                    <FormInput
                                        id="email"
                                        placeholder="Email"
                                        onChange={(e) => setEmail(e.target.value)}
                                        value={email}

                                    />
                                </FormGroup>
                                <FormGroup>
                                    <label htmlFor="tel">Phone Number</label>
                                    <FormInput
                                        placeholder="Tel"
                                        type="tel"
                                        id="tel"
                                        value={mobilePhone}
                                        onChange={(e) => setMobilePhone(e.target.value)} />
                                </FormGroup>

                            </Col>
                            <Col lg="6" md="12" sm="12">
                                <FormGroup>
                                    <label htmlFor="Address">Address</label>
                                    <FormInput
                                        id="Address"
                                        placeholder="Address"
                                        value={address}
                                        onChange={(e) => setAddress(e.target.value)}
                                    />
                                </FormGroup>
                                <FormGroup>
                                    <label htmlFor="Country">Country</label>
                                    <FormInput
                                        id="Country"
                                        placeholder="Country"
                                        value={country}
                                        onChange={(e) => setCountry(e.target.value)}
                                    />
                                </FormGroup>
                                <FormGroup>
                                    <label htmlFor="City">City</label>
                                    <FormInput
                                        id="City"
                                        placeholder="City"
                                        value={city}
                                        onChange={(e) => setCity(e.target.value)} />
                                </FormGroup>
                            </Col>
                        </Row>
                    </CardBody>
                </Card>
            </Container>
        </>
    )
}

export default AddSupplier
